import logo from './logo.svg';
import './App.css';
import Login from './screens/login'

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route >
            <Login></Login>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
